import logo from './logo.svg';
import './App.css';
import Header from "./Components/Header";
import {Footer} from "./Components/Footer";
import {Todos} from "./Components/Todos";

function App() {
  let todos = [
    {
      sno: 1,
      title: "Go to Market",
      desc: "Job 1"
    },
    {
      sno: 2,
      title: "Go to Mall",
      desc: "Job 2"
    },
    {
      sno: 3,
      title: "Go to Ghat",
      desc: "Job 3"
    }
  ]

  return (
    <>
    <Header title="ToDos-List"/ >
    <Todos todos={todos}/>
    <Footer/>
    </>
  );
}

export default App;
